import React, { Fragment } from 'react';
import styled from 'styled-components';
// import {useHistory} from 'react-router-dom';

const Wrapper = styled.section`
    width: 100%;

    .button {
        margin-top: 100px;
    }
`;

const Grid = () => {

    return(
        <Fragment>
            <Wrapper>
                <input className='button' type='file' onChange='fileUpload(this)'/>
            </Wrapper>
        </Fragment>
    );
};

export default Grid;
